#!/bin/python3

import sys
from uu import Error

# https://www.hackerrank.com/challenges/pmix/problem
# Complete the 'pmix' function below. (solution: https://programs.programmingoneonone.com/2021/07/hackerrank-mixing-proteins-problem-solution.html?m=1)
#
# The function is expected to return a STRING.
# The function accepts following parameters:
#  1. STRING s
#  2. INTEGER k
#
# Constraints
# 1 <= N <= 1000000
# 1 <= K <= 1000000000

#     A   B   C   D
#     _   _   _   _
# A|  A   B   C   D
# B|  B   A   D   C
# C|  C   D   A   B
# D|  D   C   B   A

def pmix(s, k):
    c2i = {'A': 0, 'B': 1, 'C': 2, 'D': 3}
    i2c = ['A', 'B', 'C', 'D']
    n = len(s)
    s = [c2i[x] for x in s]
    s = [s, [0] * n]
    a, b = 1, 0

    while k > 0:
        a ^= b
        b ^= a
        a ^= b
        
        cp2 = 1
        for i in range(29, 0, -1):
            if k - (1 << i) >= 0:
                cp2 = 1 << i
                break
                
        k -= cp2

        for i in range(n):
            s[b][i] = s[a][i] ^ s[a][(i + cp2) % n]

    result = ''

    for i in s[b]:
        result += i2c[i]
        
    return result;

def assertThat(expected, result):
    if (expected != result):
        raise Error('Expected does not match result', expected, result)
    else:
        print('Passed', expected[0:20], result[0:20])

assertThat('DDDDA', pmix('AAAAD', 15))
assertThat('DDDDA', pmix('AAAAD', 150))
assertThat('DDA', pmix('CBC', 10))
assertThat('DDA', pmix('CBC', 1))
assertThat('ADD', pmix('CBC', 11))
assertThat('AAAAABBAAAAAABB', pmix('ABABABABABABABA', 1000000000))

val = ''
expected = ''
assertThat(expected, pmix(val, 17005002))
